const Navbar = () => {
    const classes = useStyles();
    const user = null;

    return (
        <AppBar className={classes.appBar} position="static" color="inherit">
            <div className={classes.brandContainer}>
            <Typography className={classes.heading} variant="h2" align="center">GGSIPU</Typography>
            <img className={classes.image} src={ggsipu} alt="ggsipu" height="60" />
            </div>
            <Toolbar className={classes.toolbar}>

            </Toolbar> 
        </AppBar>
    )
};

export default Navbar;
